    polygon: {
        draw: {
            enable: true,
            stroke: {
                color: "rgb(255,0,0)"
            }
        }
    },
    interactivity: {
      events: {
          onhover: {
              enable: true,
              mode: "repulse"
          },
      }
  },
  modes: {
    bubble: {
        distance: 250,
        duration: 2,
        size: 0,
        opacity: 0
    },
    repulse: {
        distance: 400,
        duration: 4
    }
}


